import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { Utente } from 'src/app/model/utente/utente';
import { UtenteService } from 'src/app/services/utente-Service/utente.service';

@Component({
  selector: 'app-lista-utenti',
  templateUrl: './lista-utenti.component.html',
  styleUrls: ['./lista-utenti.component.css']
})
export class ListaUtentiComponent {
  utenti?: Utente[];

  constructor(private service: UtenteService, private router: Router) { }

  ngOnInit(): void{
    this.reloadData();
  }
  reloadData() {
    this.service.getEmployeesList()
    .subscribe(data => {
      this.utenti = data;
      //console.log(data);
    });
  }
}
